import React, { Component, Fragment }  from 'react';
import logo from './logo.svg';
import './App.css';
import { get_products }  from './test';


class ProductList extends Component {

    constructor(props, state) {
        super(props, state);

        this.state = {
            products: [],
        }
    }

}
